import Vue from 'vue'
import App from './App.vue'
import SuiVue from '../node_modules/semantic-ui-vue';
import VueRouter from '../node_modules/vue-router';

Vue.config.productionTip = false

Vue.use(SuiVue).use(VueRouter);

new Vue({
  render: h => h(App),
}).$mount('#app')
